CALL FOR PAPERS VOLUME 6, ISSUE 8

About GJESRM (Scientific Journal Impact Factor: 3.799,)

The "GLOBAL JOURNAL OF ENGINEERING SCIENCES AND RESEARCH MANAGEMENT” is a pre-reviewed, monthly, online international research journal, which publishes original articles, research articles, review articles with top-level work from all areas of Engineering Research and their application including Mechanical, Civil, Electrical, Chemical, Electronics, Mathematics and Geological,  etc. Researchers in all Management technology and Engineering fields are encouraged to contribute articles based on recent research. Journal publishes research articles and reviews within the whole field of Engineering Research, and it will continue to provide information on the latest trends and developments in this ever-expanding subject.

To maintain a high-quality journal, manuscripts that appear in the GJESRM  have been subjected to a rigorous review process. This includes blind reviews by three or more members of the editorial review board, followed by a detailed review by the GJESRM editors.

Subject Category: 

Cover all branches of Engineering and Science (Management)

Important Dates:

·Paper Submission:   05 August 2019.

·Review Results (Acceptance/Rejection) Notification: Within 02  Days after submitting paper.

·Published Online on : 10 August 2019 .

Publication Charges:

Indian Author(s)

Rs 1500/- upto 3 authors, after 3 authors charges will be Rs 500/author 

Rs 300/author for Hard copy of certificate.

Foreign Author(s)

$ 80 USD upto 6 Authors 

Submission Procedure:

Manuscript are invited in MS Word format and to be submitted via mail on infogjesrm@gmail.com mailto:articles@ijesrt.com,  

Please note that Review Papers/Articles are also acceptable. 

Once a paper is accepted, authors are assumed to cede copyrights of the paper over to GJESRM. All papers will be acknowledged and referred.

FINAL PAPER SUBMISSION:

Each final full text paper (.doc) along with the corresponding signed copyright transfer form should be submitted by Email: infogjesrm@gmail.com mailto:infogjesrm@gmail.com 

